import React from 'react'
import {HeaderButton} from 'react-navigation-header-buttons'
import {Ionicons} from '@expo/vector-icons'

export const AppHeaderIcon = (props) => (
    <HeaderButton
        {...props}
        iconComponent={Ionicons}
        iconSize={25}/>
    )
